/*Table structure for table `purchase` */

DROP TABLE IF EXISTS `purchase`;

CREATE TABLE `purchase` (
  `id` varchar(200) default NULL,
  `username` varchar(200) default NULL,
  `sellername` varchar(200) default NULL,
  `pname` varchar(200) default NULL,
  `pprize` varchar(200) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `purchase` */

insert  into `purchase`(`id`,`username`,`sellername`,`pname`,`pprize`) values ('3','naveen','laxman','mobile','25000');

/*Table structure for table `register` */

DROP TABLE IF EXISTS `register`;

CREATE TABLE `register` (
  `fname` varchar(200) default NULL,
  `lname` varchar(200) default NULL,
  `email` varchar(200) default NULL,
  `mobile` varchar(200) default NULL,
  `address` varchar(200) default NULL,
  `username` varchar(200) default NULL,
  `password` varchar(200) default NULL,
  `role` varchar(200) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `register` */

insert  into `register`(`fname`,`lname`,`email`,`mobile`,`address`,`username`,`password`,`role`) values ('venkat','rao','venkatarao.ganipisetty@gmail.com','9966499110','hyderabad','venkat','venkat','Officer'),('naveen','rao','naveenurs@gmail.com','9874563210','hyderabad','naveen','naveen','Concumer'),('laxman','rao','laxman@gmail.com','1234567890','hyderabad','laxman','laxman','Seller');

